import React from 'react'

const Home = () => {

  var styles = {
    h1: {
      color:"Red",
      padding:"100px",
      fontsize: "300%",
      margin: "auto",
      width: "1000px",
    }
  }

  return (
    <h1 style={styles.h1}>Welcome to Real Estate Broker Application</h1>
  );
}

export default Home
